import React, { useEffect, useParams, useHistory } from 'react';

function TitleSearch() {
  const { url } = useParams();
  const history = useHistory();

  useEffect(() => {
    // Redirect automatically when the component mounts
    history.push(url);
  }, [history, url]);

  return (
    <div>
      
      <p>Redirecting to: {url}</p>
    </div>
  );
}

export default TitleSearch;
